// RegisterForm.js
import "../styles/RegisterForm.css"
import React, { useEffect } from 'react';
import ApiInteraction from './ApiInteraction';



const RegisterForm = () => {

  useEffect(() => {
  const apiUrl = 'https://dev-mrp.insby.tech/api';
  const username = 'hQtwpolwKTjUkNAkZGeSiOkhp2OP8UA6TAPyA7bOWLFXTPPJOMzQUOOhLg43uXoFIuA5T4yKySJnHZhhVNWBqfNLcaKBfrAx';
  const password = 'lolci3wdjsHDhFsQOnubYma5Zl33BPwE4NA5wftU9qxJnmIkP3ju8qw0F6ECjF4kvmp3SwNuLZrEMQezkFHqOMYjCBVJJzxv';


  const credentials = btoa(`${username}:${password}`);
  const headers = { Authorization: `Basic ${credentials}` };

  const customerSignIn = async () => {
    try {
      const response = await axios.post(
        `${apiUrl}/session/customer-sign-in`,
        {
          autoRegister: true,
          login: 'test@gmail.com',
          password: '123',
          confirmPassword: '123',
        },
        { headers }
      );

      console.log('Customer Sign In Response:', response.data);
    } catch (error) {
      console.error('Customer Sign In Error:', error);
    }
  };
  customerSignIn();
  })
  return (
    <div>
        <div className='title'>
      <h2>Sign Up</h2>
      <p>Enter your details to get started.</p>
      </div>
      <form>
        <div>
          <label>Email</label>
          <input type="email"   placeholder='Enter your email address'/>
        </div>
        <div>
          <label>Password</label>
          <input type="password"   placeholder='Enter a strong password'/>
        </div>
        <div>
          <label>Confirm Password</label>
          <input type="password"   placeholder='Confirm your password'/>
        </div>
        <div>
          <button className='registration-button' type="submit"  style={{ backgroundColor: 'red', color: 'white' }}>
            Register
          </button>
        </div>
        <div>
            <span> Already have an account?</span> <a className="log-in-page" href='http://localhost:3000/login'> Log in</a>
        </div>
        <ApiInteraction />
      </form>
    </div>
  );
};

export default RegisterForm;
